import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './UpdateAnimalPage.css'; // Importa el archivo de estilos

const UpdateAnimalPage = () => {
    const [animalId, setAnimalId] = useState('');
    const [animalName, setAnimalName] = useState('');
    const [isEditing, setIsEditing] = useState(false);
    const [animalData, setAnimalData] = useState({
        name: '',
        species: '',
        birthDate: '',
        caretaker: '',
        habitat: '',
    });

    const navigate = useNavigate();

    const handleEdit = () => {
        // Habilitar la edición de los campos
        setIsEditing(true);
    };

    const handleUpdate = () => {
        // Lógica para enviar los datos actualizados al backend o almacenarlos
        console.log('Datos actualizados:', animalData);
        // Aquí iría la llamada a la API para actualizar el animal en la base de datos
        setIsEditing(false);
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setAnimalData((prevData) => ({
            ...prevData,
            [name]: value,
        }));
    };

    return (
        <div className="update-container">
            <h1 className="update-title">Actualizar animal</h1>
            <form className="update-form">
                <div className="form-group">
                    <label htmlFor="animalId">ID del animal a actualizar:</label>
                    <input
                        type="number"
                        id="animalId"
                        value={animalId}
                        onChange={(e) => setAnimalId(e.target.value)}
                        disabled={isEditing}
                    />
                </div>

                <div style={{ textAlign: 'center', marginBottom: '10px' }}>O</div>

                <div className="form-group">
                    <label htmlFor="animalName">Nombre del animal a actualizar:</label>
                    <input
                        type="text"
                        id="animalName"
                        value={animalName}
                        onChange={(e) => setAnimalName(e.target.value)}
                        disabled={isEditing}
                    />
                </div>

                <button
                    type="button"
                    className="update-button update"
                    onClick={handleEdit}
                >
                    Editar
                </button>

                <div className="form-group">
                    <label htmlFor="name">Nombre:</label>
                    <input
                        type="text"
                        id="name"
                        name="name"
                        value={animalData.name}
                        onChange={handleInputChange}
                        disabled={!isEditing}
                    />
                </div>

                <div className="form-group">
                    <label htmlFor="species">Especie:</label>
                    <input
                        type="text"
                        id="species"
                        name="species"
                        value={animalData.species}
                        onChange={handleInputChange}
                        disabled={!isEditing}
                    />
                </div>

                <div className="form-group">
                    <label htmlFor="birthDate">Fecha de Nacimiento:</label>
                    <input
                        type="date"
                        id="birthDate"
                        name="birthDate"
                        value={animalData.birthDate}
                        onChange={handleInputChange}
                        disabled={!isEditing}
                    />
                </div>

                <div className="form-group">
                    <label htmlFor="caretaker">Cuidador:</label>
                    <input
                        type="text"
                        id="caretaker"
                        name="caretaker"
                        value={animalData.caretaker}
                        onChange={handleInputChange}
                        disabled={!isEditing}
                    />
                </div>

                <div className="form-group">
                    <label htmlFor="habitat">Hábitat:</label>
                    <input
                        type="text"
                        id="habitat"
                        name="habitat"
                        value={animalData.habitat}
                        onChange={handleInputChange}
                        disabled={!isEditing}
                    />
                </div>

                <div className="update-button-container">
                    <button
                        type="button"
                        className="update-button update"
                        onClick={handleUpdate}
                    >
                        Actualizar
                    </button>
                    <button
                        type="button"
                        className="update-button back"
                        onClick={() => navigate('/')}
                    >
                        Atrás
                    </button>
                </div>
            </form>
        </div>
    );
};

export default UpdateAnimalPage;
